import { styled } from 'styled-components';
const Header = () => {
  return (
    <div>
      <Container>
        <Logo src="/images/logo.svg" alt="" />
      </Container>
    </div>
  );
};

const Container = styled.div`
  max-width: 1230px;
  position: fixed;
  top: 0;
  left: 0;
  margin: 0 atuo;
`;

const Logo = styled.img``;

export default Header;
